import React,{Component} from 'react';
import {
    Route,
    Router,
    Link,NavLink,
    BrowserRouter,
    StaticRouter,
    Switch,
    HashRouter} from 'react-router-dom';
import './static/css/index.css';
import Head from "component/home";



class App extends Component{

    render() {
      return (
          <BrowserRouter>
              <div>BrowserRouter</div>
              <Head></Head>
          </BrowserRouter>
      )
  }
}

export default App;
